    [],nt"num_tags": 2,nt"name": "anaho-island-national-wildlife-refuge-population-estimates-of-colonial-birds-1990",nt"isopen":
    false,nt"url": null,nt"notes": "This memorandum discusses the results of
    population estimates for Anaho Island National Wildlife Refuge within the Stillwater
    Wildlife Management Area. The report first gives an introduction to Anaho Island,
    followed by methods for obtaining population counts. A summary of  the American
    White Pelican on Anaho Island from 1903 to 1990 is also included. Next are the results
    of the study and bird count numbers. Other bird sightings are included as well as
    aerial photographs displaying the locations of nesting colonies. American White
    Pelican, Double-crested Cormorant, Great Blue Heron, California Gull, and Black-crowned
    Night Heron are species discussed.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
